import React from "react";
import { Menu } from "semantic-ui-react";

function Header() {
    return <Menu>
        <Menu.Menu position="middle">
            <Menu.Item>中大壢中熱食部線上訂餐系統</Menu.Item>
        </Menu.Menu>

        <Menu.Menu position="right">
            <Menu.Item>登入</Menu.Item>
        </Menu.Menu>
    </Menu>;
}

export default Header;
